【サイズ】約W118X86XH73mm ・290cc<br>
磁器(近江赤土）・白化粧・色釉・酸化<br>
日本製<br>


白化粧と釉薬がかかった部分の柔らかな表情が素敵なマグカップです。<br><br>

ところどころに土の粒で凸凹と感じる場合がございます。<br><br>

○ご使用前に目止めの処理をして下さい。<br>
○色ムラがございます。商品毎の色みにかなりのバラツキがございます。<br>
○釉薬垂れがある場合があります。<br><br>

【ご確認事項】<br>
※一つ一つ手作りです。厚み・重さ・サイズ・色に差が出る事がございます。<br>
※手作りですので、スレ・傷・汚れなどがある場合もございます。<br>
※焼成時の条件により焼き上がりの色にかなりのバラつきが出る事があります。<br>
※加工段階での多少の磨きキズや凹み・歪みがある場合もございます。<br>
メーカーより“良品”として販売されております。ご理解頂きご注文をお願い致します。<br><br>

<br><hr><br>
イメージ写真の商品はセットではありません。<br>
<br>
実際のお色と多少異なる事があります。<br>
